import React from 'react';
import '../../Header.css';
import bars from '../../../../img/bars-solid.svg';

function Menu() {
    return (
      <div className="header__navBar">
          <button><img src={bars} alt="fa-bars" /></button>
      </div>
    );
}

export default NavBar;
